drop table IF EXISTS skola; 

CREATE TABLE `skola` (
  `sifra` int(11) NOT NULL primary key auto_increment,
  `naziv` varchar(250) DEFAULT NULL,
  `grad` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

drop table IF EXISTS grad; 

CREATE TABLE `grad` (
  `sifra` int(11) NOT NULL primary key auto_increment,
  `naziv` varchar(250) DEFAULT NULL,
  `zupanija` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

drop table IF EXISTS zupanija; 

CREATE TABLE `zupanija` (
  `sifra` int(11) NOT NULL primary key auto_increment,
  `naziv` varchar(250) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;




ALTER TABLE `grad`
  ADD CONSTRAINT `grad_ibfk_1` FOREIGN KEY (`zupanija`) REFERENCES `zupanija` (`sifra`);

